    getWeeklyHoliday(event) {
        this.dateArr = [];
        console.log(event);
        event.forEach(element => {
            if (element.key != 7) {
                let finYear;
                var sysDate = new Date();
                var year = sysDate.getFullYear();
                var month = new Date().getMonth();
                month > 2 ? finYear = year : finYear = year - 1;
                var full = [];
                var fullDate = `01/04/${finYear}`;
                full = fullDate.split(' ');
                var date = full[0].split(/\//);
                var newDate = date[1] + '/' + date[0] + '/' + date[2];
                var formatDate = new Date(newDate);
                // starting and end date
                let start = moment__WEBPACK_IMPORTED_MODULE_16__(formatDate);
                let end = moment__WEBPACK_IMPORTED_MODULE_16__(start).add(12, 'M');
                var arr = [];
                // Get "next" day
                let tmp = start.clone().day(element.key);
                if (tmp.isAfter(start, 'd')) {
                    arr.push(tmp.format('DD/MM/YYYY'));
                }
                while (tmp.isBefore(end)) {
                    tmp.add(7, 'days');
                    arr.push(tmp.format('DD/MM/YYYY'));
                }
                for (let i = 0; i < arr.length - 1; i++) {
                    this.dateArr.push(arr[i]);
                }
            }
            else {
                this.dateArr = [];
            }
        });
    }
